import React from 'react'
import { useState, useEffect } from 'react';

const A = () => {
    let id = 0
    const [Data, setData] = useState("")
    const [List, setList] = useState([])
    const handlerAdd = () => {
        console.log(Data);
    }
    useEffect(() => {
        console.log(Data);
        return () => {
            console.log("卸载前");
        }
    }, [])

    return (
        <>
            <h1> 这是A组件</h1>
            <input type="text" id=''
                value={Data} onChange={(eve) => { setData(eve.target.value) }}
            />
            <button onClick={() => handlerAdd()}>确定</button>
            <hr />
            <ul>
                {List.map((item,index)=>{
                    return <li key={item.id}> item.Date</li>
                })}
            </ul>
        </>

    )
}

export default A
